package com.example.listviewtext;

public class Fruit {
	private String name;
	private int imageId;
	public Fruit(String name, int imageId){
		this.name = name;
		this.imageId=imageId;
	}
	
	public String getName(){
		return name;
	}
	
	public int getImageId() {
		// TODO Auto-generated method stub
		return imageId;
	}

}
